import React from 'react'
import './bootstrap.min.css';

import List from './components/List';
import Add from './components/Add';
import Update from './components/Update';
import Signup from './components/Signup';
import Login from './components/Login';
import AddTribe from './components/AddTribe'

import { Switch,Route,Link } from 'react-router-dom';

/*
on doit creer les fichier:
-list
-formulaire pour l'ajout
-formulaire pour la modification
-suppression
tous cela doit etre sous forme de component
*/
function App() {
  return (
    // exact pour marquer liste comme route pa defaut
    <div>
      
      <Switch>
        <Route path="/"  component={List}  exact /> 
        <Route path="/add" component={Add}/>
        <Route path="/update/:id" component={Update}/>  
        <Route path="/signup" component={Signup}/>
        <Route path="/login" component={Login}/>
        <Route path="/add_tribe" component={AddTribe}/>
      </Switch>
      </div> 
  );
}

export default App
